INSERT [app].[DatasetQuery] ([Id], [UniversalId], [Shape], [Name], [CategoryId], [Description], [SqlStatement], [Created], [CreatedBy], [Updated], [UpdatedBy]) VALUES (N'7d90433e-f36b-1410-8127-00ffffffffff', N'urn:leaf:dataset:platelet', 1, N'Platelets', NULL, NULL, N'SELECT
	personId = CONVERT(NVARCHAR(10),m.person_id)
	, encounterId = CONVERT(NVARCHAR(10),m.visit_occurrence_id)
	, category = ''lab''
	, code = ''plt''
	, effectiveDate = m.measurement_date
	, specimenType = ''blood''
	, valueString = ''''
	, valueQuantity = CAST(ROUND((500 - 100) * RAND(LEFT(CONVERT(BIGINT, HASHBYTES(''MD5'', CONVERT(NVARCHAR(100), NEWID()))), 5)) + 100,0) AS DECIMAL(18,1))
	, valueUnit = ''''
FROM dbo.measurement AS m
	LEFT OUTER JOIN dbo.concept AS c_obs
	ON m.measurement_concept_id = c_obs.concept_id
WHERE m.measurement_concept_id = 2212648', CAST(N'2018-12-21T11:03:21.677' AS DateTime), N'ndobb', CAST(N'2018-12-21T11:03:21.677' AS DateTime), N'ndobb')
